"१. या फेरीमध्ये सामील होण्यासाठी \"सामील व्हा\" वर क्लिक करा;
२. इतर लोक ज्यांनी थेट माइक घेतला आहे तेदेखील गेममध्ये सामील होऊ शकतात;
३. गेम सुरू करण्यासाठी तुम्हाला किमान २ लोकांची आवश्यकता आहे;
४. निष्पक्ष राहण्यासाठी, गेम सुरू झाल्यानंतर तो वापरकर्ता काढून टाकला जात नाही किंवा गेम समाप्त होत नाही तोपर्यंत तुम्ही खेळाडूला गेममधून काढू शकत नाही;
५. ❤ वर क्लिक करून, तुम्ही गेमच्या मार्गदर्शन तत्त्वांचे पुनरावलोकन करू शकता;"

"१. काढून टाकलेल्या लोकांचा स्कोअर पुढे सुरू राहणार नाही, त्यामुळे स्कोअरबोर्ड काढून टाकला जाईल;
२. माइक्स असलेले वापरकर्ते गेम सुरू असताना मधूनच गेममध्ये सामील होऊ शकत नाही;
३. तुम्ही गेम सुरू असताना माइक खाली टाकल्यास किंवा रूम सोडून गेल्यास, तुम्हाला पराजित समजले जाईल. तुम्हाला काढून टाकले जाईल आणि तुम्ही पुन्हा गेमवर परत जाऊ शकणार नाही;
४. जागा बदलल्यामुळे स्कोअरवर परिणाम होणार नाही;"

"१. मालक प्रत्येक फेरीचे काउंटडाउन निवडतो;
२. काउंटडाउन समाप्त झाल्यानंतर, लक्ष्य केलेल्या लोकांना काढून टाकण्यासाठी स्नाइपर शूट करेल;
३. एका व्यक्तीला काढून टाकल्यानंतर, पुढील फेरीचे काउंटडाउन ताबडतोब सुरू होईल;"

"१. गेम सुरू झाल्यानंतर, स्कोअर मिळालेल्या डायमंड्सच्या स्कोअरवर आधारित असेल;
२. सर्वात कमी स्कोअर असलेल्यांना स्नाइपर्स लक्ष्य करतील;
३. एकाच वेळी समान सर्वात कमी स्कोअर असलेले अनेक लोक असल्यास, या सर्व लोकांना स्नाइपर्स लक्ष्य करतील;"
